import { response } from "express";
import React, { useEffect } from "react";


function Home(props) {

    useEffect(()=>{
         fetch('https://api.example.com/data')
         .then((response)=>{
            console.log(response)
         })
         .catch((e)=>{
            console.log
         })
    },[])

  return (
    <div></div>
  )
}

export default Home;
